import React from "react";
import TodoItem from "./TodoItem";
const todos = [
  {
    _id: "23",
    title: "finish yor homework",
    isCompleted: false,
  },
  {
    _id: "233",
    title: "wash dishes",
    isCompleted: false,
  },
  {
    _id: "243",
    title: "watch TV",
    isCompleted: false,
  },
];
const Home = () => {
  return (
    <div className="bg-gray-900 h-screen">
      Home
      {todos.map((todo) => (
        <TodoItem key={todo._id} todo={todo} />
      ))}
    </div>
  );
};
export default Home;
